// reducers.js
import { combineReducers } from '@reduxjs/toolkit';
import registrationReducer from './registrationSlice'; // Pastikan file ini benar
import profileReducer from './profileSlice'; // Tambahkan jika perlu

const rootReducer = combineReducers({
  registration: registrationReducer, // Tambahkan reducer sesuai kebutuhan
  profile: profileReducer,           // Tambahkan reducer lainnya
});

export default rootReducer;
